        <video id="my-video" controls preload="auto" width="640" height="264">
            <source src={'https://vd2.bdstatic.com/mda-jb1y28tijunvff2e/sc/mda-jb1y28tijunvff2e.mp4'} type='video/mp4' />
        </video>
